import { useState } from "react"
import { useImmer } from "use-immer";
import cl from '../styles/Addqn.module.css'
import AddQuickNote from "../UI/AddQuickNote";

const Addqn = (props) =>{

    return(<div className={cl.Block}> 
            <AddQuickNote createQuickNote={props.createQuickNote} quickNoteText={props.quickNoteText} setQuickNoteText={props.setQuickNoteText}>+</AddQuickNote>
    </div>)
}

export default Addqn
